import React from 'react'

function PositionTime() {
  return (
    <div>
        <div className=" flex items-center justify-center my-6">
            <div className="text-white text-xl font-extralight">
                <p>Thursday, 18 January 2024 </p>
            </div>
        </div>
    </div>
  )
}

export default PositionTime
